INSERT INTO [dbo].[AspNetUsers]
           ([Id]
           ,[UserName]
           ,[NormalizedUserName]
           ,[Email]
           ,[NormalizedEmail]
           ,[EmailConfirmed]
           ,[PasswordHash]
           ,[SecurityStamp]
           ,[ConcurrencyStamp]
           ,[PhoneNumber]
           ,[PhoneNumberConfirmed]
           ,[TwoFactorEnabled]
           ,[LockoutEnd]
           ,[LockoutEnabled]
           ,[AccessFailedCount]
           ,[LegacyId]
           ,[FirstName]
           ,[LastName]
           ,[LastLogin])
     select 
			NEWID() as Id, 
			Email as UserName,
			UPPER(Email) as NormalizedUserName, 
			Email as Email, 
			UPPER(Email) as NormalizedEmail,
			0 as EmailConfirmed, 
			Password as PasswordHash,
			NEWID() as SecurityStamp,
			NEWID() as ConcurrencyStamp,
			null as PhoneNumber,
			0 as PhoneNumberConfirmed,
			0 as TwoFactorEnabled,
			null as LockoutEnd,
			IsActive as LockoutEnabled,
			0 as AccessFailedCount,
			Id as LegacyId,
			Name as FirstName,
			Surname as LastName,
			LastLogin from web.Users
			
		where Id not in (182, 2, 178, 191, 1, 192, 194, 198, 201)
GO
DECLARE @id INT = (SELECT ISNULL(MAX(Id),0) FROM web.Users);
Print (@id);
DBCC checkident('dbo.AspNetUsers', reseed, @id);
SET IDENTITY_INSERT [dbo].[AspNetUsers] OFF
GO
